import { jsPDF } from "jspdf";
var font =
  "";
var callAddFont = function () {
  // @ts-ignore
  this.addFileToVFS("TypeWriter-normal.ttf", font);
  // @ts-ignore
  this.addFont(
    "TypeWriter-normal.ttf",
    "TypeWriter",
    "normal"
  );
};
jsPDF.API.events.push(["addFonts", callAddFont]);
